// SPDX-License-Identifier: Unlicensed

pragma solidity ^0.8.7;

contract Test1{

    address owner;

    constructor(){
        owner = msg.sender;
    }

    struct User{
        address walletAddress;
        string name;
        uint amount;

    }

    User[] public users;
    mapping(address => uint) public investors;


    function addUser(address walletAddress, string memory name, uint amount) public {
        users.push(User(walletAddress, name, amount));
        addToInvestorMapping(walletAddress, amount);
    }

    function addToInvestorMapping(address walletAddress, uint amount) public {
        investors[walletAddress] = amount;
    }

    function getInvestorByAddress(address walletAddress) public view returns(address, uint){

    }

    function transfer(address walletAddress) payable public {
        transferToAddress(walletAddress);
    }

    function transferToAddress(address walletAddress) private {
        for(uint i = 0; i < users.length; i++){
            if(users[i].walletAddress == walletAddress){
                users[i].amount += msg.value;
            }
        }
    }

    function balanceOf(address walletAddress) public view returns(uint){
        for(uint i = 0; i < users.length; i++){
            if(users[i].walletAddress == walletAddress){
                return users[i].amount;
            }
        }

        return 999;
    }




}

